[{"location":"anotherPage.html#The-Lognormals-Module","page":"An other page","title":"The Lognormals Module","text":"","category":"section"},{"location":"anotherPage.html","page":"An other page","title":"An other page","text":" Lognormals","category":"page"},{"location":"anotherPage.html#Module-Index","page":"An other page","title":"Module Index","text":"","category":"section"},{"location":"anotherPage.html","page":"An other page","title":"An other page","text":"Modules = [Lognormals]\nOrder   = [:constant, :type, :function, :macro]","category":"page"},{"location":"anotherPage.html#Detailed-API","page":"An other page","title":"Detailed API","text":"","category":"section"},{"location":"anotherPage.html","page":"An other page","title":"An other page","text":"Modules = [Lognormals]\nOrder   = [:constant, :type, :function, :macro]","category":"page"},{"location":"anotherPage.html#Lognormals.AbstractMoments","page":"An other page","title":"Lognormals.AbstractMoments","text":"AbstractMoments\n\nA representation of statistical moments of a distribution\n\nThe following functions are supported\n\nlength(M::AbstractMoments): get the number of defined moments\n\nThe following getters return a single moment or  throw an error if the moment has not been defined\n\nmean(M::AbstractMoments): get the mean\nvar(M::AbstractMoments): get the variance\nskewness(M::AbstractMoments): get the variance\nkurtosis(M::AbstractMoments): get the variance\ngetindex(M::AbstractMoments,i): get the ith moment, i.e. indexin [i]\n\nMoments-objects be converted to AbstractArray by\n\nconvert(AbstractArray, M::AbstractMoments)\n\nThe basic implementation 'Moments' is immutable and convert(AbstractArray, M::Moments) returns an SArray{N,T}\n\nExamples\n\nM = Moments(1,0.2)\nlength(M) == 2\nvar(M) == M[2]\nismissing(kurtosis(M))\ntypeof(convert(AbstractArray,M)) <: AbstractArray\n\n\n\n\n\n","category":"type"},{"location":"anotherPage.html#Lognormals.plusTwo-Tuple{Any}","page":"An other page","title":"Lognormals.plusTwo","text":"plusTwo(x)\n\nSum the numeric \"2\" to whatever it receives as input\n\nA more detailed explanation can go here, although I guess it is not needed in this case\n\nArguments\n\nx: The amount to which we want to add 2\n\nNotes\n\nNotes can go here\n\nExamples\n\njulia> five = plusTwo(3)\n5\n\n\n\n\n\n","category":"method"},{"location":"anotherPage.html#StatsBase.fit-Tuple{Type{Distributions.LogNormal},AbstractMoments}","page":"An other page","title":"StatsBase.fit","text":"fit(Distribution, M::Moments)\n\nFit a statistical distribution to its moments \n\nArguments\n\nDistribution: The type of distribution to fit\nM: The moments of the distribution\n\nExamples\n\nD = fit(LogNormal, Moments(3.2,4.6))\n\n\n\n\n\n","category":"method"},{"location":"index.html#Lognormals.jl","page":"Index","title":"Lognormals.jl","text":"","category":"section"},{"location":"index.html","page":"Index","title":"Index","text":"Documentation for Lognormals.jl","category":"page"},{"location":"index.html","page":"Index","title":"Index","text":"see the github repository.","category":"page"}]
